text:
Διάλεξε το γράμμα της ερώτησης που σε ενδιαφέρει:

Α - Πώς εξαπλώνεται ο ιός;
Β - Πώς να προστατευτώ;
Γ - Πρέπει να φοράω μάσκα;
Δ - Μύθοι για τον ιό.

Α - Ποια είναι τα συμπτώματα;
Β - Να ανησυχώ;
Γ - Ποιοι κινδυνεύουν περισσότερο;
Δ - Υπάρχουν άτομα με ανοσία;
Ε - Ψευδείς ειδήσεις και φήμες.
Ζ - Γραμμές υποστήριξης
